import React from "react";

const Login = () => {
  return (
    <div className="login">
      <div>
        <span></span>
      </div>
    </div>
  );
};

export default Login;

const FieldRenderer = (props) => {
  return;
  <div>
    <span>{props.label}</span>
  </div>;
};
